import React, { Component } from 'react';
import {Image} from 'react-bootstrap'
import Logo from '../Images/20190402_122358.jpg'

class PageLogo extends Component {
  render() {
    return (
      <div className="page-logo d-flex justify-content-center "  style={{
            backgroundColor: "rgba(0,0,0,.7)",
            width: "300px",
            height: "300px",
            borderRadius: "50%"
        }}>
                <Image className="logo-image align-self-center" src={Logo} height="250" width="250" roundedCircle />
    </div>
    );
  }
}

export default PageLogo;
